        //zzStartRead = zzEndRead = s.offset;
        zzStartRead = s.offset;
        zzEndRead = zzStartRead + s.count - 1;
        zzCurrentPos = zzMarkedPos /*= zzPushbackPos */ = s.offset;
        zzLexicalState = YYINITIAL;
        zzReader = reader;
